import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    const passwordGenerator = document.querySelector(".passwordGenerator");
  });

  return (
    <>
      <div className="myBox position-absolute top-50 start-50 translate-middle ">
        <h1 className="passwordGenerator">Password Generator</h1>
        <input
          type="text"
          value="10"
          style={{}}
          className="inputDisplay fw-bolder display-6 text-light"
          readOnly
        />
        <div>
          <label for="customRange1" class="form-label">
            Example range
          </label>
          <input type="range" class="form-range" id="customRange1" />
        </div>
        <div className="choose">
          <div className="">
            <label htmlFor="uppercase">A-Z</label>
            <input type="checkbox" name="" id="uppercase" />
          </div>
        </div>

        <button
          type="button"
          className="btn btn-danger w-25 text-center fw-bolder "
        >
          Generate Password
        </button>
      </div>
    </>
  );
};

export default App;
